import React from 'react';

const categories = [
    { id: 1, name: "Biryani", image: "/biryani.jpg" },
    { id: 2, name: "Pizza", image: "/pizza.jpg" },
    { id: 3, name: "Burgers", image: "/burger.jpeg" },
    { id: 4, name: "Pasta", image: "/pasta.jpg" },
    { id: 5, name: "Sandwiches", image: "/sandwich.jpg" }
];

export default function FoodCategories() {
    return (
        <div>
            {/* Banner */}
            <div style={{ width: "100%", height: "200px", backgroundImage: "url('/banner.jpg')", backgroundSize: "cover", backgroundPosition: "center" }}></div>

            {/* Categories Section */}
            <div style={{ display: "flex", justifyContent: "space-around", flexWrap: "wrap", padding: "20px" }}>
                {categories.map((category) => (
                    <div key={category.id} style={{ width: "150px", textAlign: "center", margin: "10px" }}>
                        <img src={category.image} alt={category.name} style={{ width: "100%", height: "100px", objectFit: "cover", borderRadius: "10px" }} />
                        <h5 style={{ marginTop: "10px" }}>{category.name}</h5>
                    </div>
                ))}
            </div>
        </div>
    );
}
